class ProjectListMemberRequestModel {  int? manageProjectId;  int? departmentId;  int? branchId;  int? projectRoleId;  int? staffTitleId;  int? page;  ProjectListMemberRequestModel(      {this.manageProjectId,        this.departmentId,        this.branchId,        this.projectRoleId,        this.staffTitleId, this.page});  ProjectListMemberRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectId = json['manage_project_id'];    departmentId = json['department_id'];    branchId = json['branch_id'];    projectRoleId = json['project_role_id'];    staffTitleId = json['staff_title_id'];    page = json['page'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_id'] = this.manageProjectId;    data['department_id'] = this.departmentId;    data['branch_id'] = this.branchId;    data['project_role_id'] = this.projectRoleId;    data['staff_title_id'] = this.staffTitleId;    data['page'] = this.page;    return data;  }}class ProjectDeleteMemberRequestModel{  int? manageProjectStaffId;  int? manageProjectId;  int? manageProjectRoleId;  ProjectDeleteMemberRequestModel(      {this.manageProjectStaffId,        this.manageProjectId,        this.manageProjectRoleId});  ProjectDeleteMemberRequestModel.fromJson(Map<String, dynamic> json) {    manageProjectStaffId = json['manage_project_staff_id'];    manageProjectId = json['manage_project_id'];    manageProjectRoleId = json['manage_project_role_id'];  }  Map<String, dynamic> toJson() {    final Map<String, dynamic> data = new Map<String, dynamic>();    data['manage_project_staff_id'] = this.manageProjectStaffId;    data['manage_project_id'] = this.manageProjectId;    data['manage_project_role_id'] = this.manageProjectRoleId;    return data;  }}